import React from 'react';

const UserList = (users) => {
	return (
		<div className='userList'>
			<div>
			<h1>Users</h1>
			</div>
			{
				users
				? (
					<div>
						<div className="activeContainer">
							<h2>
								${
									users.map(({name})=>(
											<div key={name} className="activeItem">
												{name}
											</div>
										)
									)
								}
							</h2>
						</div>
					</div>
				)
				: null}
			}
		</div>
	);
};

export default UserList
